import React from 'react';
import PropTypes from 'prop-types';

const AssetTypeInfo = props => {
  const { Data } = props;
  return (
    <div>
      <p>Type details here </p>
    </div>
  );
};

AssetTypeInfo.propTypes = {
  Data: PropTypes.array.isRequired
};

export default AssetTypeInfo;
